import React from 'react';
import PropTypes from "prop-types";

const snskuks = ({Component}) => {
    return (
        <>
            <Head>
                <meta charSet="UTF-8"/>
                <title>SNSKuks</title>
            </Head>
        <Component/>
        </>
    );
};

snskuks.propTypes = {
    Component: PropTypes.elementType.isRequired,
}

export default snskuks;
